import React from "react";
import FormControl from "../FormContorl/FormControl";
import styles from "./Textarea.module.css";
const TextArea = (props) => {
  return (
    <FormControl>
      <textarea className={styles["textarea"]}></textarea>
    </FormControl>
  );
};
export default TextArea;
